module.exports.maxN = maxN;
module.exports.maxMessageSize = maxMessageSize;
module.exports.maxM = maxM;
module.exports.maxMN = maxMN;
module.exports.logN = logN;
module.exports.N = N;
module.exports.balanceMsg = balanceMsg;
module.exports.zero = () => zero;
module.exports.one = () => one;
module.exports.two = () => two;
module.exports.G = () => G;
module.exports.H = (
    tokenId = new Buffer(new Uint8Array(32)),
    tokenNftId = -1
) => {
  if (isZero(tokenId)) return H;
  if (!mapGenerators[tokenId.toString("hex") + tokenNftId])
    mapGenerators[tokenId.toString("hex") + tokenNftId] = GetBaseG1Element(
        G,
        0,
        tokenId,
        tokenNftId
    );
  return mapGenerators[tokenId.toString("hex") + tokenNftId];
};
module.exports.Gi = () => Gi;
module.exports.Hi = () => Hi;
module.exports.oneN = () => oneN;
module.exports.twoN = () => twoN;
module.exports.ip12 = () => ip12;
module.exports.Generators = Generators;
module.exports.subAddressPrefix = subAddressPrefix;
module.exports.sha256 = sha256;
module.exports.ripemd160 = ripemd160;

const mutex = new Mutex();
let initialised = false;

module.exports.mcl = mcl;
module.exports.noble = noble;

module.exports.Init = async () => {
  await mutex.runExclusive(async () => {
    try {
      if (initialised) return;

      await mcl.init(mcl.BLS12_381);

      mcl.setETHserialization(true); // Ethereum serialization

      zero = new mcl.Fr();
      one = new mcl.Fr();
      two = new mcl.Fr();

      zero.setInt(0);
      one.setInt(1);
      two.setInt(2);

      G = mcl.deserializeHexStrToG1(
          "97f1d3a73197d7942695638c4fa9ac0fc3688c4f9774b905a14e3a3f171bac586c55e83ff97a1aeffb3af00adb22c6bb"
      );

      H = new mcl.G1();
      let Hx = new mcl.Fp(); Hx.a_ = new Uint32Array(Gens[0]);
      let Hy = new mcl.Fp(); Hy.a_ = new Uint32Array(Gens[1]);
      let Hz = new mcl.Fp(); Hz.a_ = new Uint32Array(Gens[2]);
      H.setX(Hx)
      H.setY(Hy)
      H.setZ(Hz)

      for (var i = 0; i < maxMN; ++i) {
        let H_ = new mcl.G1();
        let H_x = new mcl.Fp(); H_x.a_ = new Uint32Array(Gens[i*6+3]);
        let H_y = new mcl.Fp(); H_y.a_ = new Uint32Array(Gens[i*6+4]);
        let H_z = new mcl.Fp(); H_z.a_ = new Uint32Array(Gens[i*6+5]);
        H_.setX(H_x)
        H_.setY(H_y)
        H_.setZ(H_z)
        let G_ = new mcl.G1();
        let G_x = new mcl.Fp(); G_x.a_ = new Uint32Array(Gens[i*6+6]);
        let G_y = new mcl.Fp(); G_y.a_ = new Uint32Array(Gens[i*6+7]);
        let G_z = new mcl.Fp(); G_z.a_ = new Uint32Array(Gens[i*6+8]);
        G_.setX(G_x)
        G_.setY(G_y)
        G_.setZ(G_z)
        Hi.push(H_);
        Gi.push(G_);
      }

      assert(Hi.length == maxMN);
      assert(Gi.length == maxMN);

      oneN = VectorDup(one, maxN);
      twoN = VectorPowers(two, maxN);
      ip12 = InnerProduct(oneN, twoN);

      initialised = true;
    } catch (e) {
      console.error(e);
    }
  });
};

const VectorDup = (x, n) => {
  let ret = [];

  for (var i = 0; i < n; i++) {
    ret.push(x);
  }

  return ret;
};

module.exports.VectorDup = VectorDup;

const InnerProduct = (a, b) => {
  assert(a.length == b.length);

  let res = new mcl.Fr();

  for (var i = 0; i < a.length; ++i) {
    if (i == 0) res = mcl.mul(a[i], b[i]);
    else res = mcl.add(res, mcl.mul(a[i], b[i]));
  }

  return res;
};

module.exports.InnerProduct = InnerProduct;

const VectorPowers = (x, n) => {
  let res = [];

  if (n == 0) return res;

  res[0] = one;

  if (n == 1) return res;

  res[1] = x;

  for (var i = 2; i < n; ++i) {
    res[i] = mcl.mul(res[i - 1], x);
  }

  return res;
};

module.exports.VectorPowers = VectorPowers;

module.exports.VectorPowerSum = (x, n) => {
  let res = VectorPowers(x, n);
  let ret = new mcl.Fr();

  for (var i in res) {
    let it = res[i];
    ret = mcl.add(ret, it);
  }

  return ret;
};

module.exports.VectorCommitment = (a, b) => {
  assert(a.length == b.length);
  assert(a.length <= maxMN);

  let bases = [];
  let exps = [];

  for (var i = 0; i < a.length; ++i) {
    bases.push(Gi[i]);
    bases.push(Hi[i]);
    exps.push(a[i]);
    exps.push(b[i]);
  }

  return mcl.mulVec(bases, exps);
};

module.exports.VectorSubtract = (a, b) => {
  let ret = [];

  for (var i = 0; i < a.length; i++) {
    ret[i] = mcl.sub(a[i], b);
  }

  return ret;
};

module.exports.VectorAdd = (a, b) => {
  assert(a.length == b.length);

  let ret = [];

  for (var i = 0; i < a.length; i++) {
    ret[i] = mcl.add(a[i], b[i]);
  }

  return ret;
};

module.exports.VectorAddSingle = (a, b) => {
  let ret = [];

  for (var i = 0; i < a.length; i++) {
    ret[i] = mcl.add(a[i], b);
  }

  return ret;
};

module.exports.VectorScalar = (a, b) => {
  let ret = [];

  for (var i = 0; i < a.length; i++) {
    ret[i] = mcl.mul(a[i], b);
  }

  return ret;
};

module.exports.Hadamard = (a, b) => {
  assert(a.length == b.length);

  let ret = [];

  for (var i = 0; i < a.length; i++) {
    ret[i] = mcl.mul(a[i], b[i]);
  }

  return ret;
};

module.exports.VectorSlice = (a, start, stop) => {
  assert(start <= a.length && stop <= a.length && start >= 0 && stop >= 0);

  let ret = [];

  for (var i = start; i < stop; i++) {
    ret[i - start] = a[i];
  }

  return ret;
};

module.exports.HadamardFold = (vec, scale, a, b) => {
  assert((vec.length & 1) == 0);

  let sz = parseInt(vec.length / 2);
  let out = [];

  for (var n = 0; n < sz; ++n) {
    let c0 = vec[n];
    let c1 = vec[sz + n];
    let sa, sb;
    if (scale) sa = mcl.mul(a, scale[n]);
    else sa = a;
    if (scale) sb = mcl.mul(b, scale[sz + n]);
    else sb = b;
    let l = mcl.mul(c0, sa);
    let r = mcl.mul(c1, sb);
    out[n] = mcl.add(l, r);
  }

  return out;
};

module.exports.CrossVectorExponent = (
    size,
    A,
    Ao,
    B,
    Bo,
    a,
    ao,
    b,
    bo,
    scale,
    extra_point,
    extra_scalar
) => {
  assert(size + Ao <= A.length);

  assert(size + Bo <= B.length);

  assert(size + ao <= a.length);

  assert(size + bo <= b.length);

  assert(size <= maxMN);

  assert(!scale || size == parseInt(scale.length / 2));

  assert(!!extra_point == !!extra_scalar);

  let bases = [];
  let exps = [];

  for (var i = 0; i < size; ++i) {
    exps[i * 2] = a[ao + i];
    bases[i * 2] = A[Ao + i];
    exps[i * 2 + 1] = b[bo + i];

    if (scale) exps[i * 2 + 1] = mcl.mul(exps[i * 2 + 1], scale[Bo + i]);

    bases[i * 2 + 1] = B[Bo + i];
  }
  if (extra_point) {
    bases.push(extra_point);
    exps.push(extra_scalar);
  }

  return mcl.mulVec(bases, exps);
};

const bytesArray = (n) => {
  let buf = new Buffer(
      (n.toString(16).length % 2 ? "0" : "") + n.toString(16),
      "hex"
  );

  let a = [];

  for (var i = 0; i < buf.length; i++) {
    a.push(buf.readUInt8(i));
  }

  while (a.length != 8) {
    a.unshift(0);
  }

  return new Uint8Array(a);
};

module.exports.bytesArray = bytesArray;

const CombineUint8Array = (arrays) => {
  // sum of individual array lengths
  let totalLength = arrays.reduce((acc, value) => acc + value.length, 0);
  if (!arrays.length) return null;

  let result = new Uint8Array(totalLength);

  // for each array - copy it over result
  // next array is copied right after the previous one
  let length = 0;
  for (let array of arrays) {
    result.set(array, length);
    length += array.length;
  }

  return result;
};

module.exports.CombineUint8Array = CombineUint8Array;

module.exports.HashG1Element = (el, salt) => {
  let elSer = el.serialize();

  let ret = CombineUint8Array([
    new Uint8Array([elSer.length]),
    new Uint8Array(elSer),
    bytesArray(salt).reverse(),
  ]);

  return new Uint8Array(sha256sha256(new Buffer(ret)).buffer);
};

class Transcript {
  constructor() {
    this.reset();
  }

  reset() {
    this.data = [];
    this.bytes = 0;

    return this;
  }

  add(p, addlength = true) {
    if (!p) return this;
    if (addlength) this.data.push(new Uint8Array([p.length]));
    this.data.push(p);

    this.bytes += p.length + addlength;

    return this;
  }

  finalize() {
    let pad = Buffer.alloc(64);
    pad.writeUInt8(0x80, 0);
    pad = pad.slice(0, 1 + ((119 - (this.bytes % 64)) % 64));

    let size = Buffer.alloc(8);
    size.writeUInt32BE(this.bytes << 3, 4);

    this.add(pad, false);
    this.add(size, false);
  }

  compressData() {
    return ((arrays) => {
      // sum of individual array lengths
      let totalLength = arrays.reduce((acc, value) => acc + value.length, 0);
      if (!arrays.length) return null;

      let result = new Uint8Array(totalLength);

      // for each array - copy it over result
      // next array is copied right after the previous one
      let length = 0;
      for (let array of arrays) {
        result.set(array, length);
        length += array.length;
      }

      return result;
    })(this.data);
  }

  getHash() {
    let compressed = this.compressData();
    let first = sha256(compressed);

    this.reset();
    this.add(first, false);

    compressed = this.compressData();

    let second = sha256(compressed);

    this.finalize();

    return new Uint8Array(second.buffer);
  }
}

module.exports.Transcript = Transcript;

const Delta = (yn, z) => {
  const left = mcl.mul(mcl.sub(z, mcl.mul(z, z)), InnerProduct(oneN, yn));
  const right = mcl.mul(mcl.mul(z, mcl.mul(z, z)), ip12);
  const result = mcl.sub(left, right);
  return result;
};

const SerializeG1 = (writer, el, ignoreZero = false) => {
  if (!writer) {
    writer = new BufferWriter();
  }

  if (!(el instanceof mcl.G1)) {
    let g1 = new mcl.G1();
    g1.deserialize(el);
    el = g1;
  }

  if (el.isZero() && ignoreZero)
  {
    writer.writeVarintNum(
        0
    );
  } else {
    writer.writeVarintNum(
        el.serialize().length
    );
    writer.write(el.serialize());
  }

  return writer;
};

const SerializeG2 = (writer, el) => {
  if (!writer) {
    writer = new BufferWriter();
  }

  writer.writeVarintNum(
      el instanceof mcl.G1 ? el.serialize().length : el.length
  );
  writer.write(el instanceof mcl.G1 ? el.serialize() : el);

  return writer;
};

const SerializeFr = (writer, el) => {
  if (!writer) {
    writer = new BufferWriter();
  }

  writer.writeVarintNum(
      el instanceof mcl.Fr ? el.serialize().length : el.length
  );
  writer.write(el instanceof mcl.Fr ? el.serialize() : el);

  return writer;
};

const DeserializeG1 = (reader) => {
  let size = reader.readVarintNum();

  let el = reader.read(size);

  return el.toString('hex');
};

const DeserializeG2 = (reader) => {
  let size = reader.readVarintNum();

  let el = reader.read(size);

  return el.toString('hex');
};

const DeserializeFr = (reader) => {
  let size = reader.readVarintNum();

  let el = reader.read(size);

  return el.toString('hex');
};

const SerializeProof = (writer, proof) => {
  if (!writer) {
    writer = new BufferWriter();
  }

  proof = proof || {
    V: [],
    L: [],
    R: [],
    A: new mcl.G1(),
    S: new mcl.G1(),
    T1: new mcl.G1(),
    T2: new mcl.G1(),
    taux: new mcl.Fr(),
    a: new mcl.Fr(),
    b: new mcl.Fr(),
    t: new mcl.Fr(),
    mu: new mcl.Fr(),
  };

  writer.writeVarintNum(proof.V.length);
  if (proof.V.length > 0) {
    for (var i = 0; i < proof.V.length; i++) {
      SerializeG1(writer, proof.V[i]);
    }
  }
  writer.writeVarintNum(proof.L.length);
  if (proof.L.length > 0) {
    for (var i = 0; i < proof.L.length; i++) {
      SerializeG1(writer, proof.L[i]);
    }
  }
  writer.writeVarintNum(proof.R.length);
  if (proof.R.length > 0) {
    for (var i = 0; i < proof.R.length; i++) {
      SerializeG1(writer, proof.R[i]);
    }
  }

  SerializeG1(writer, proof.A);
  SerializeG1(writer, proof.S);
  SerializeG1(writer, proof.T1);
  SerializeG1(writer, proof.T2);
  SerializeFr(writer, proof.taux);
  SerializeFr(writer, proof.mu);
  SerializeFr(writer, proof.a);
  SerializeFr(writer, proof.b);
  SerializeFr(writer, proof.t);

  return writer;
};

const DeserializeProof = (reader) => {
  let proof = {
    V: [],
    L: [],
    R: [],
  };

  let size = reader.readVarintNum();
  for (var i = 0; i < size; i++) {
    proof.V.push(DeserializeG1(reader));
  }

  size = reader.readVarintNum();
  for (var i = 0; i < size; i++) {
    proof.L.push(DeserializeG1(reader));
  }

  size = reader.readVarintNum();
  for (var i = 0; i < size; i++) {
    proof.R.push(DeserializeG1(reader));
  }

  proof.A = DeserializeG1(reader);
  proof.S = DeserializeG1(reader);
  proof.T1 = DeserializeG1(reader);
  proof.T2 = DeserializeG1(reader);

  proof.taux = DeserializeFr(reader);
  proof.mu = DeserializeFr(reader);
  proof.a = DeserializeFr(reader);
  proof.b = DeserializeFr(reader);
  proof.t = DeserializeFr(reader);

  return proof;
};

module.exports.Delta = Delta;
module.exports.SerializeFr = SerializeFr;
module.exports.SerializeG1 = SerializeG1;
module.exports.SerializeG2 = SerializeG2;
module.exports.SerializeProof = SerializeProof;
module.exports.DeserializeFr = DeserializeFr;
module.exports.DeserializeG1 = DeserializeG1;
module.exports.DeserializeG2 = DeserializeG2;
module.exports.DeserializeProof = DeserializeProof;
